metadata:
  name: bov-web-lb
  namespace: boa-web
  labels:
    ves.io/app_type: boa-tsa
  annotations: {}
  description: ""
  disable: false
spec:
  domains:
    - bov.volt.foobz.com.au
  https_auto_cert:
    http_redirect: true
    add_hsts: false
    no_mtls: {}
    tls_config:
      default_security: {}
    default_header: {}
    enable_path_normalize: {}
  downstream_tls_certificate_expiration_timestamps:
    - {}
  advertise_on_public_default_vip: {}
  default_route_pools: []
  routes:
    - simple_route:
        http_method: ANY
        path:
          prefix: /
        origin_pools:
          - pool:
              tenant: f5-apac-sp-yhsgmcye
              namespace: boa-web
              name: boa-frontend-pool
            weight: 1
            priority: 0
            endpoint_subsets: {}
        disable_host_rewrite: {}
  app_firewall:
    tenant: f5-apac-sp-yhsgmcye
    namespace: shared
    name: default
  add_location: false
  no_challenge: {}
  more_option:
    request_headers_to_add: []
    request_headers_to_remove: []
    response_headers_to_add: []
    response_headers_to_remove: []
    max_request_header_size: 60
    custom_errors:
      "4": string:
    jwt: []
    idle_timeout: 30000
    disable_default_error_pages: false
    enable_path_normalize: {}
  user_id_client_ip: {}
  disable_rate_limit: {}
  waf_exclusion_rules: []
  data_guard_rules: []
  blocked_clients: []
  trusted_clients: []
  ddos_mitigation_rules: []
  service_policies_from_namespace: {}
  round_robin: {}
  multi_lb_app: {}
  host_name: ""
  dns_info: []
  state: VIRTUAL_HOST_READY
  auto_cert_state: CertificateValid
  auto_cert_info:
    auto_cert_state: CertificateValid
    auto_cert_expiry: 2022-05-20T02:48:42Z
    auto_cert_subject: CN=bov.volt.foobz.com.au
    auto_cert_issuer: CN=R3,O=Let's Encrypt,C=US
    dns_records: []
